import React, {Component} from 'react';
import './TodoItem.css';

class TodoItem extends Component {
    render() {   
        const { item } = this.props;
        let className = 'TodoItem';
        return (
            <div className="TodoItem">
                <p>{this.props.item.title}</p>
            </div>
        );
    }
}
export default TodoItem;
